script: |
  super -f text -I q5601.spq | sort > q5601.out

inputs:
  - name: q5601.spq
    data: |
      SELECT ALL 5 FROM tab0 (FORMAT parquet) AS cor0 WHERE - col1 * - 0 NOT IN ( + 62 * - col1, + col2 * + - col2, - + ( col2 ), + - 6, + - 3, - col1 * col0, + col1 );
  - name: tab0

outputs:
  - name: q5601.out
    data: |
      5
      5
      5
